header {
    
color: #fff;
padding: 2rem;
text-align: center;
border-bottom: 5px solid #355c7d; /* Garis bawah header */

}

header h1 {
    margin: 0;
    font-size: 2.5rem; /* Ukuran font yang lebih besar untuk header */
}

main {
    padding: 2rem;
    display: flex;
    justify-content: center;
}

.profile {
    display: flex;
    flex-direction: column;
    align-items: center;
    background: #ffffff; /* Latar belakang putih untuk card */
    border-radius: 15px; /* Sudut yang lebih membulat */
    box-shadow: 0 8px 16px rgba(0, 0, 0, 0.15); /* Bayangan yang lembut */
    max-width: 600px; /* Ukuran card yang lebih kecil */
    margin: 2rem;
    padding: 2rem;
    transition: box-shadow 0.3s ease; /* Transisi pada shadow */
}

.profile:hover {
    box-shadow: 0 12px 24px rgba(0, 0, 0, 0.2); /* Bayangan lebih gelap saat hover */
}

.profile-img-container {
    margin-bottom: 1.5rem; /* Jarak antara gambar dan info */
    overflow: hidden; /* Menyembunyikan bagian gambar yang meluas saat zoom */
    border-radius: 50%; /* Membuat kontainer gambar berbentuk lingkaran */
}

.profile-img {
    border-radius: 50%;
    width: 150px; /* Ukuran gambar profil yang lebih kecil */
    height: 150px;
    border: 4px solid #6c5b7b; /* Border warna ungu pastel di sekitar gambar */
    transition: transform 0.5s ease, box-shadow 0.3s ease; /* Transisi yang lebih halus */
}

.profile-img:hover {
    transform: scale(1.2); /* Zoom-in pada hover dengan skala lebih besar */
    box-shadow: 0 8px 24px rgba(0, 0, 0, 0.3); /* Tambahkan bayangan saat zoom */
}

.profile-info {
    text-align: center; /* Rata tengah untuk teks */
}

.profile-info h2 {
    margin-bottom: 1rem;
    font-size: 1.8rem; /* Ukuran font yang lebih besar untuk nama */
    color: #333; /* Warna teks gelap untuk kontras */
}

.profile-info p {
